import React from 'react'
import { Route, Redirect } from "react-router-dom";

const PrivateRoute = ({ component: Component, path}) => (
  <Route {...path} render={(props) => (
      currentUser !== "none" ?
      <Component {...props} />
    : <Redirect to="/login"/>
  )} />
)

export default PrivateRoute
